                        <p style=""text-align:justify"">In recently held 7th&nbsp;National Drama Workshop and Festival 2015 organized in Notre Dame College, Milestone College participants won the highest number of prizes that include 1st&nbsp;and 2nd&nbsp;positions in Extempore Acting.</p>

                        <p style=""text-align:justify"">We do strictly maintain a strong security system inside the campus for every academic and hostel buildings and outside the premises, under the command of a retired Defence personnel. In collaboration with our core academic administrative set-up our security force is always on guard addressing every single issues and solving");
            WriteLiteral(@" problems with stress on religious, ethical and moral dimensions of human characteristics. It takes special care so that no student can commit any juvenile delinquency or get involved in any type of addiction whatsoever.</p>

                        <p style=""text-align:justify"">We have our own permanent campus at a single place in the heart of Uttara Model Town (3rd&nbsp;Phase) just by the ongoing Metro Rail Terminal Uttara, minutes away from the Rupayan City, Fantasy Island, BRTA office and Fire Brigade Station. It stands in the middle point from Savar, Ashulia, Mirpur, Mohakhali, Gulshan, Dakkhinkhan, Uttarkhan, Pubail and Gazipur. Besides there is a good traffic network from and to this campus connecting the aforementioned points of the city. Apart from the public transport routes we have a sound transport facility of our own. With the opening of Metro Rail transport link, Motijheel is going to be a matter of only 35 minutes’ distance from our permanent Campus. We have both resident and non-resident opt");
